import { Component, OnInit } from '@angular/core';
import { AccountService } from '../../services/account.service';
import { AccountSummary } from '../../models/account-summary.model';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.scss']
})
export class DashboardComponent implements OnInit {
  summary?: AccountSummary;
  loading = false;
  error = '';

  constructor(private accountService: AccountService) {}

  ngOnInit(): void {
    this.loading = true;
    this.accountService.getSummary().subscribe({
      next: summary => {
        this.summary = summary;
        this.loading = false;
      },
      error: () => {
        this.error = 'No fue posible obtener tu información. Intenta más tarde.';
        this.loading = false;
      }
    });
  }
}
<section class="dashboard">
  <div *ngIf="loading" class="card">Cargando tu aventura de ahorro...</div>
  <div *ngIf="error" class="card error">{{ error }}</div>
  <div *ngIf="summary" class="dashboard__content">
    <div class="card highlight">
      <h1>¡Hola {{ summary.childName }}!</h1>
      <p>Tu ahorro actual es de <strong>{{ summary.balance | currency:'USD':'symbol-narrow' }}</strong></p>
    </div>
    <section class="card">
      <h2>Últimos movimientos</h2>
      <ul>
        <li *ngFor="let transaction of summary.transactions">
          <span>{{ transaction.description }}</span>
          <span [class.positive]="transaction.amount >= 0">{{ transaction.amount | currency:'USD':'symbol-narrow' }}</span>
        </li>
      </ul>
    </section>
    <section class="card">
      <h2>Mis metas</h2>
      <div class="goals">
        <article class="goal" *ngFor="let goal of summary.goals">
          <h3>{{ goal.name }}</h3>
          <p>Meta: {{ goal.targetAmount | currency:'USD':'symbol-narrow' }}</p>
          <p>Para: {{ goal.targetDate | date }}</p>
        </article>
      </div>
    </section>
  </div>
</section>
